  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kenai National
  Wildlife Refuge summarizes refuge activities from May through August of 1952.  The
  report begins with general information about weather conditions, water conditions,
  and fires on the refuge.  Wildlife- including migratory birds, upland game birds,
  big game animals, fur animals, and fish- is also covered.  The report includes a
  refuge development section which discusses physical developments and plantings on
  the refuge.  Economic uses of the refuge are outlined; timber removal and special
  permits were the only uses during this period.  A progress report on field investigations
  is included- topics include natural forest areas and caribou range investigations.
  \ The public relations section of the report discusses recreational uses of the
  refuge, refuge visitors, refuge participation, hunting, fishing, and enforcement.\",\n\t\"license_title\":
